The SPARQL query to extract this information from DBpedia would look something like this:

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>

SELECT ?childParent1 ?childParent2
WHERE {
  ?childParent1 a dbpedia-owl:Royalty;
               dbpedia-owl:hasChild ?child.
  ?child a dbpedia-owl:Person;
           dbpedia-owl:hasParent ?childParent1.

  ?childParent2 a dbpedia-ontology:Person;
               dbpedia-ontology:hasParent ?childParent1;
               dbpedia-ontology:residesAt <http://dbpedia.org/property/elevation> "96.0".
}
```

This query looks for:
- Royalty individuals (`?childParent1`) who have a child (`?child`).
- Those children (`?child`) and their parents (`?childParent1`).
- Individuals (`?childParent2`) who reside at an elevation of 96.0 meters and are the parents of the children found in the previous step.

