The SPARQL query to extract this information from DBpedia would look something like this:

```sparql
PREFIX dbpedia: <http://dbpedia.org/ontology/>

SELECT ?deathPlace ?birthPlace WHERE {
  ?politician a dbpedia:Person;
    dbpedia:officeHolderRole [ dbpedia:office_holding "Governor of Chiba" ];
    dbpedia:father ?father.
  ?father a dbpedia:Person;
    dbpedia:role [ dbpedia:label "Father of Emperor Go-Mizunoo" ].
  OPTIONAL { ?father dbpedia:deathPlace ?deathPlace }
  OPTIONAL { ?commander a dbpedia:Person; dbpedia:role [ dbpedia:label "Commander in Boshin War" ] .
    ?commander dbpedia:birthPlace ?birthPlace }
}
```

This query does the following:
- Selects individuals (`?politician`, `?father`) who held the office of Governor of Chiba and whose father is the father of Emperor Go-Mizunoo.
- Optionally retrieves their death places (`?deathPlace`).
- Optionally retrieves the birth place of a commander involved in the Boshin War (`?birthPlace`).

