}
```

This query finds bands that include Fredrik Thordendal as a member and selects the band name (`?band_name`) and the associated musician (`?musical_artist`).

Next, we need to adjust the query to find the specific musical artist for each band:

```sparql
PREFIX dbppro: <http://dbpedia.org/ontology/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

// Query for Fredrik Thordendal's band and its associated musical artist
SELECT ?band_name ?musical_artist WHERE {
  ?band a dbppro:Band ;
           dbppro:hasMember ?fredrik_thordendal .
  ?fredrik_thordendal a dbppro:Musician .
  OPTIONAL { ?band dbppro:associatedMusicalArtist ?musical_artist }
  FILTER (lang(?musical_artist) = "en")  // Assuming English language
}
```

For Donald Maynard Dokken, we would repeat the above query with his name replacing `?fredrik_thordendal`.

