SELECT ?band_name ?musical_artist WHERE {
  ?band a dbppro:Band ;
           rdfs:label "Watchtower" .  // Assuming the band's label is "Watchtower"
  ?band dbppro:associatedMusicalArtist ?musical_artist .
}
