A SPARQL query to DBpedia could look like this:

```sparql
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dbo: <http://dbpedia.org/ontology/>

SELECT ?capital ?resting_place WHERE {
  ?awardee a dbo:Person ;
            dbo:hasAward "Hero of the Soviet Union" .
  ?awardee dbo:deathPlace ?death_place .
  OPTIONAL { ?death_place rdfs:label ?capital . }
  OPTIONAL { ?death_place rdf:type dbo:AdministrativeDivision . }
  OPTIONAL { ?death_place dbo:name ?resting_place . }
}
```

This query looks for a person who has been awarded the Hero of the Soviet Union, their death place (which might be the resting place), and attempts to infer or directly state the capital and resting place.

