A SPARQL query to DBpedia could look like this:

```
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#

SELECT ?writer
WHERE {
  ?album a rdf:Statement ;
            rdf:subject <http://dbpedia.org/ontology/Album> ;
            rdf:predicate rdfs:label ; # Assuming the album's label is its identifier
            rdf:object "What U See Is What U Get" .
  ?band a rdf:Statement ;
            rdf:subject <http://dbpedia.org/ontology/Band> ;
            rdf:predicate dbpedia:P31 ; # Band of musical artist(s)
            rdf:object ?band_uri . 
  ?writer rdfs:label ?band_uri . 
}
```

This query selects the label (identifier) of the album "What U See Is What U Get" and then finds bands associated with that label, querying for their labels to determine the writer(s), assuming the writer's label is linked to the band.

